import React from 'react';

export default function Playlist(props) {
  let shower;
  if (props.block === 0 || props.block === 2) {
    shower = (
      <div>
        <div>2. Juan</div>
        <div>3. Manuel</div>
      </div>
    );
  } else if (props.block === 1 || props.block === 3) {
    shower = (
      <div>
        <div>2. Juan</div>
        <div>3. Manuel</div>
      </div>
    );
  }
  return (
    <div className="col-6">
      <div className="tile double totoro">
        <div className="player text-left">
          <h4>
            <u>Shower Order:</u>
            <div>1. Jackeline</div>
          </h4>
        </div>
      </div>
    </div>
  );
}
